import React, { Component } from 'react';
import './mm_header.css';

class Header extends Component {
  render() {
    return (
      <div className= "_head">
        <Header_logo/>
        <Header_menu/>
        <Header_info/>
      </div>
    );
  }
}

class Header_logo extends Component {
    render() {
      return (
        <div className= "_head_elements">
          <img src="https://chargeback.com/wp-content/uploads/capital-one-logo-300x104.png" alt="title" height="80vh"></img>
        </div>
      );
    }
  }

  class Header_menu extends Component {
    render() {
      return (
        <div className= "_head_elements">
          Head menu
        </div>
      );
    }
  }

  class Header_info extends Component {
    render() {
      return (
        <div className= "_head_elements">
          Head info
        </div>
      );
    }
  }





export default Header;
